import './rodape.css'

const Rodape = () =>{
    return(
        <footer className='rodape'>
            <img src='/imagens/'/>
            <img src='/imagens/'/>
            <img src='/imagens/'/>
            <img src='/imagens/logo.png'/>
            <img src='/imagens/'/>
        </footer>
    )
}

export default Rodape
